import React from "react";
import { Nav, Navbar } from "react-bootstrap";
import styled from "styled-components";

const Styles = styled.div`
  .navbar {
    background-color: #800000;
  }
  .navbar-brand{
    color: #efefef;
    font-size: 2.2em;
    &:hover {
      color: black;
    }
    font-family: 'Alfa Slab One';
  }
  .navbar-nav .nav-link {
    color: #efefef;
    font-size: 1.8em;
    &:hover {
      color: black;
    }
  }
`;
export const NavigationBar = () => {
  return (
    <Styles>
      <Navbar expand="lg">
        <Navbar.Brand href="/"><img></img></Navbar.Brand>
        <Navbar.Toggle aria-controls= "basic-navbar-nav"/>
        <Navbar.Collapse id = "basic-navbar-nav">
            <Nav className = "ml-auto">
                <Nav.Item><Nav.Link href ="/exterior-estimates">Exterior</Nav.Link></Nav.Item>
                <Nav.Item><Nav.Link href ="/interior-estimates">Interior</Nav.Link></Nav.Item>
                <Nav.Item><Nav.Link href ="/cabinet-estimates">Cabinet</Nav.Link></Nav.Item>
            </Nav>
        </Navbar.Collapse>
      </Navbar>
    </Styles>
  );
};
